script: |
  super -f text -I q11160.spq | sort > q11160.out

inputs:
  - name: q11160.spq
    data: |
      SELECT ALL * FROM tab2 (FORMAT parquet) AS cor0 WHERE ( + col0 ) NOT IN ( - - 7, col2 * + 96 * - - col1 + - + 67 );
  - name: tab2

outputs:
  - name: q11160.out
    data: |
      46	51	23
      64	77	40
      75	67	58
